// Libraries
import React from 'react'

// Children
import Address from './../address'

class Receiver extends React.Component {
  constructor (props) {
    super(props)
    this.data = {}
    this.state = Object.assign({}, this.data)
  }

  validate () {
    return this.refs['address'].validate()
  }

  export () {
    return Object.assign({}, this.state, {
      address: this.refs['address'].export()
    })
  }

  // Renders receiver component
  render () {
    return (
      <div>
        <p className='content'>
          <span className='title'>Receptor</span>
        </p>
        <Address ref='address' />
      </div>
    )
  }
}

export default Receiver
